              <div className="bg-white p-4 rounded-3 shadow-sm">
                <i className="bi bi-envelope-fill text-warning fs-1 mb-3"></i>
                <h5 className="fw-bold">Email</h5>
                <p className="text-muted">Henrybuena052@gmail.com</p>
